import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "bootstrap/dist/css/bootstrap.min.css";
import reportWebVitals from "./reportWebVitals";
import "./App.css";

ReactDOM.render(
  <React.StrictMode>
    <input
      class="form-control color"
      id="searchInput"
      type="text"
      placeholder="Search.."
    />
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);

reportWebVitals();
